%@  ha=get(h,'Position');
%@  h=uicontrol('Style','Listbox',...
%@            'ButtonDownFcn','close',...
%@            'CallBack','close',...
%@            'Position',[0 0 ha(3) ha(4)],...
%@	    'FontName','Courier',...
%@	    'BackgroundColor',[.8 .8 .8],...
%@	    'String',txt);
%@  waitfor(h)
%@end
%@
%@%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%% initialization
%@
%@flag=1;
%@
%@if size(y,1)<size(y,2)
%@  y=y';
%@end
%@if size(x,1)<size(x,2)
%@  x=x';
%@end
%@
%@if size(x,2)>1, error('The dimension of x must be one.'); end
%@
%@if nargin<5 | isempty(oi)
