%@%
%@%
%@%    Examples: a = sin((1:1000) * 2 * pi/67);
%@%              b = sin((1:1000) * 2 * pi/67) + rand(1,1000);
%@%              X = phasesynchro(a,b,2,17,'nonorm','euclidean');
%@
%@%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%% programme properties
%@
