%@  if size(x,1) < t*(m-1)+1 | size(y,1) < t*(m-1)+1
%@     error(['Too less data',10,...
%@            'Either too much NaN or the number of columns in the vectors do not match.'])
%@  end
%@
%@    Nx=size(x,1); Ny=size(y,1);
